import React, { useEffect, useState } from 'react';
import Tour from './Tour';

const Tours = ({ tours }) => {
  return (
    <section>
      <div className='title'>
        <h2>our tours</h2>
        <div className='underline'></div>
      </div>
      <div>
        {tours.map((tour) => {
          return <Tour key={tour.id} tour={tour} />;
        })}
      </div>
      <p>{tour.info}</p>
    </section>
  );
};

export default Tours;
